@Component({
  selector: 'app-menu',
  templateUrl: './menu.component.html',
  styleUrls: ['./menu.component.css']
})
export class MenuComponent {

}
<div>
    <a routerLink="/clients">Clients</a>
    <a routerLink="/to-does">To-Do list</a>
    <a routerLink="/new">Add To-Do</a>
</div>
